Release date: 18/03/2008

Rating: 5.4

&quot;This webisode is sure to put some pep in your step. Some bop to your hop. Its the Easter special this time around and we have some pretty cool stunts and an awesome twosome serving up a heaping helping of ass. The Easter Bunny Jack The Rabbit has gone a bit psycho and looked for some victims..... I mean... contestants to take a dare for some cash. Taser treadmill...blowdart egg hunting...Antiquing some poor shmuck with flour...and I think he took advantage of the naked blonde bunny hunting for eggs. Zoe is an upscale girl who was dining out with her friend. The waiter at this gourmet restaurant sucked so we decided to invite them over to our hotel room and let them order five star room service in exchange for a buffet at their vagina diners.&quot;
